function Resume() {
    return (
        <div style={resumeCSS}>
            <div style={sectionCSS}>
                Education
            </div>
        </div>
    )
}

const resumeCSS = {
    background: "#fff",
    paddingTop: "90px",
    paddingBottom: "72px",
    overflow: "hidden"
}

const sectionCSS = {
    marginBottom: "48px",
    paddingBottom: "24px",
    borderBottom: "1px solid #E8E8E8",
    width: "96%",
    maxWidth: "1020px",
    margin: "0 auto"
}

const sectionHeaderCSS = {
    paddingTop: "9px",
    width: "25%",
    position: "relative",
    padding: "0 20px",
    minHeight: "1px",
    float: "left"
}



export default Resume;
